    col=min(col,pt1(p));
    col=min(col,pt2(p));
    col=min(col,pt3(p));
    col=min(col,pt4(p));
   return col;
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec3 tot = vec3(0.0);

    for( int m=0; m<AA; m++ )
    for( int n=0; n<AA; n++ )
    {
     // pixel coordinates
      vec2 o = vec2(float(m),float(n)) / float(AA) - 0.5;
     vec2 p = (-iResolution.xy + 2.0*(fragCoord+o))/iResolution.y;   
 	 vec3 col=vec3(0.0);

  	  col *= 1.5 - 0.2*length(p);
      col = col*vec3(1.11,0.89,0.79);

      col=scene(p);

         tot += col;
    }

    tot /= float(AA*AA);
  fragColor = vec4(tot,1.0);
}
